Manually implementing:

```
use std::fmt;

struct Point {
    x: i32,
    y: i32,
}

impl fmt::Debug for Point {
    fn fmt(&self, f: &mut fmt::Formatter<'_>) -> fmt::Result {
        f.debug_struct("Point")
         .field("x", &self.x)
         .field("y", &self.y)
         .finish()
    }
}

let origin = Point { x: 0, y: 0 };

assert_eq!(format!("The origin is: {origin:?}"), "The origin is: Point { x: 0, y: 0 }");
```

[Run](https://play.rust-lang.org/?code=%23!%5Ballow(unused)%5D%0Afn+main()+%7B%0A++++use+std::fmt;%0A++++%0A++++struct+Point+%7B%0A++++++++x:+i32,%0A++++++++y:+i32,%0A++++%7D%0A++++%0A++++impl+fmt::Debug+for+Point+%7B%0A++++++++fn+fmt(%26self,+f:+%26mut+fmt::Formatter%3C%27_%3E)+-%3E+fmt::Result+%7B%0A++++++++++++f.debug_struct(%22Point%22)%0A+++++++++++++.field(%22x%22,+%26self.x)%0A+++++++++++++.field(%22y%22,+%26self.y)%0A+++++++++++++.finish()%0A++++++++%7D%0A++++%7D%0A++++%0A++++let+origin+=+Point+%7B+x:+0,+y:+0+%7D;%0A++++%0A++++assert_eq!(format!(%22The+origin+is:+%7Borigin:?%7D%22),+%22The+origin+is:+Point+%7B+x:+0,+y:+0+%7D%22);%0A%7D&edition=2021)

There are a number of helper methods on the [`Formatter`](struct.Formatter.html "struct std::fmt::Formatter") struct to help you with manual implementations, such as [`debug_struct`](about:blank/struct.Formatter.html#method.debug_struct "method std::fmt::Formatter::debug_struct").

Types that do not wish to use the standard suite of debug representations provided by the `Formatter` trait (`debug_struct`, `debug_tuple`, `debug_list`, `debug_set`, `debug_map`) can do something totally custom by manually writing an arbitrary representation to the `Formatter`.

```
impl fmt::Debug for Point {
    fn fmt(&self, f: &mut fmt::Formatter<'_>) -> fmt::Result {
        write!(f, "Point [{} {}]", self.x, self.y)
    }
}
```

