`Debug` implementations using either `derive` or the debug builder API on [`Formatter`](struct.Formatter.html "struct std::fmt::Formatter") support pretty-printing using the alternate flag: `{:#?}`.

Pretty-printing with `#?`:

```
#[derive(Debug)]
struct Point {
    x: i32,
    y: i32,
}

let origin = Point { x: 0, y: 0 };

assert_eq!(format!("The origin is: {origin:#?}"),
"The origin is: Point {
    x: 0,
    y: 0,
}");
```

